export function Footer(){
    return(//Inline style
        <>
        
       <h6 style={{color:"green"}}> Copyright@2024</h6>  
        </>
    )
}//named export


export function FooterCode(){
    return(
        <>
        <h6 className="footerM">Created By Sanitha</h6>
        </>
    )
}//multiple named export
